import React from "react";
import "./style.css";

function Jumbotron(props) {
  return (
    <div class="jumbotron jumbotron-fluid">
  <div class="container">

    <h1 class="display-4">
    <span class="myBlueB">B</span>
    <span class="myRedO">o</span>
    <span class="myYellowO">o</span>
    <span class="myGreenK">K</span>
    <span class="myPurpleS">S</span>
    <span class="myBlueT">T</span>
    <span class="myPinkE">E</span>
    <span class="myYellowR">R</span>
    </h1>
    <p class="lead">Google Books' lesser known, and definitely not as cute, cousin.</p>
  </div>
</div>
  );
}

export default Jumbotron;
